import styled from 'styled-components'

const TextBox = styled.div`
    width: 52%;
    height: 100%;
    color:#fff;
    padding-right: 50px;
`

const TextContents = ({children}) =>{
    return(
        <TextBox>
            {children}
        </TextBox>
    )
}

export default TextContents;
